          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "accounts": {
                      "items": {
                        "$ref": "#/components/schemas/Account"
                      },
                      "type": "array"
                    },
                    "current-round": {
                      "description": "Round at which the results were computed.",
                      "type": "integer"
                    },
                    "next-token": {
                      "description": "Used for pagination, when making another request provide this token with the next parameter.",
                      "type": "string"
                    }
                  },
                  "required": [
                    "accounts",
                    "current-round"
                  ],
                  "type": "object"
                }
              }
            },
            "description": "(empty)"
          },
          "400": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "data": {
                      "properties": {},
                      "type": "object"
                    },
                    "message": {
                      "type": "string"
                    }
                  },
                  "required": [
                    "message"
                  ],
                  "type": "object"
                }
              }
            },
            "description": "Response for errors"
          },
          "500": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "data": {
                      "properties": {},
                      "type": "object"
                    },
                    "message": {
                      "type": "string"
                    }
                  },
                  "required": [
                    "message"
                  ],
                  "type": "object"
                }
              }
            },
            "description": "Response for errors"
          }
        },
        "tags": [
          "search"
        ]
      }
